def hisen(array_):                                                                 
	array_ = np.array(array_)                                                                                                                      
	y,x = np.nonzero(array_) 
	# split array into x,y pairing list                                                                             
	for i in range(len(y)):                                                                                
	    y[i] = abs(40-y[i])  
	# convert into conventional coordination 
	return (x.tolist(),y.tolist())
